(7, 'Constitutional Courts and Parliamentary Democracy.pdf', 'Constitutional Courts And Parliamentary Democracy', NULL, 'Alec Stone Sweet', 'The article assesses the creation and subsequent evolution of systems of constitutional justice in West Europe, in light of delegation theory. The author argues that constitutional judges are better conceptualised as trustees, exercising fiduciary responsibilities, than as agents, who operate in the shadow of principals. The zone of discretion that organises the activities of constitutional courts is unusually large, in some contexts close to unlimited. The author then surveys why, and to what extent, constitutional adjudication has transformed the nature of parliamentary governance, focusing on the cases of France, Germany, Italy, and Spain. Notwithstanding important variation, certain trends are both pan-European and irreversible: traditional separation of powers doctrines are steadily eroding; legislators and administrators are being placed under the authority of an expansive, continuously evolving constitutional law; and the judiciary\\\\\\\'s participation in law making processes is becoming more overt and assertive.', 'PSCRIPT.DRV Version 4.0', 'Acrobat Distiller 4.05 for Windows', 131072, '10/24/2025, 5:58:27 PM', 'D:20011218123659', 'D:20131002092524-07\'00\'', 'null', NULL, 1.4, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Taylor And Francis Group', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317907318', 'null', '2002', 'Role of constitutional Courts', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:48:07'),
(8, 'Conceptual framework for environmental justice.pdf', 'A Conceptual Framework For Environmental Justice Based On Shared But Differentiated Responsibilities', 'Economics: 330', 'Ali, Asghar', 'Environmental justice has become a major issue in the discourses of environment. The calls for environmental equity and justice are now part of major environmental negotiations like the UNFCCC and the Kyoto Protocol, to give some examples. In this paper I locate the issues of environmental justice within the broader framework of environmental sustainability and the contemporary debates about theories of justice. The environmental justice movement in the USA, which has gained popular momentum in recent years, is briefly studied. This particular grassroots movement appears to be redefining the sustainability agenda with a strong social justice content. It has similarities with environmentally informed social justice movements in the developing world, the so- called environmentalism of the poor. Employing a critical discursive methodology I briefly and critically review some of the well-known theories of justice based on different principles of justice like need, desert and entitlement. These are looked at within the contemporary debates of universalism versus particularism or the abstract liberal versus communitarian theories and some other critical perspectives on justice. I argue for a broader conception of environmental justice that takes into account particularities but is also sensitive to the global nature of many of the environmental problems that are spread and have impacts across regions, territories and even countries. In such situations it becomes necessary as a matter of justice to take into account differentiated impacts arising out of disproportionate contributions to environmental harms or bads. I further argue that a theory of justice, which will recognize this fact, will also have to consider differentiated responsibilities.', 'Apache FOP Version 2.8', 'Apache FOP Version 2.8', 405207, '10/24/2025, 5:58:26 PM', 'D:20240125082728+01\'00\'', 'D:20011210193543Z', 'null', 'Sustainability, sustainable development, equity, justice, distributive justice, vulnerabilities, responsibility, Umwelt, Nachhaltige Entwicklung, Gerechtigkeit, Theorie', 1.4, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'University Of East Anglia, The Centre For Social And Economic Research On The Global Environment (cserge), Norwich', NULL, NULL, 'EN', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317906712', NULL, '2001', 'Environmental justice', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:49:20'),
(9, 'Critical examination of environmental public interest litigation in China.pdf', 'A Critical Examination Of Environmental Public Interest Litigation In China - Reflection On China’s Environmental Authoritarianism', 'Humanities and Social Sciences Communications, doi:10.1057/s41599-024-03047-9', 'Xin Li; Zongyue Song', 'Environmental public interest litigation is an innovative legal mechanism for humanity to address environmental crises. It not only addresses the tragedy of the commons in environmental crises but also serves as a crucial means for protecting the rights of environmentally vulnerable groups and upholding environmental justice. Over the past decade, the development of China’s environmental public interest litigation system has been promising. Thousands of such cases are filed each year, making a significant contribution to curbing the further deterioration of China’s environmental crisis. However, China still does not allow individual citizens to initiate environmental public interest litigation, and there are significant hurdles for environmental NGOs to file such lawsuits. As a result, the vast majority of environmental public interest litigation cases in China are initiated by procuratorates, which appears to be another important manifestation of China’s environmental authoritarianism. This institutional setup severely restricts the ability of China’s environmental vulnerable groups to protect their rights and masks many environmental issues that truly need improvement, hindering the realization of environmental justice. From a comparative perspective, compared to countries like the United States with more mature experiences in environmental public interest litigation, China’s system suffers from narrow subject qualifications, extensive restrictions on environmental NGOs, and excessive litigation costs. Even compared to India, another developing country, China’s environmental public interest litigation system appears conservative. Therefore, China’s environmental public interest litigation system urgently needs further reform and improvement.', 'Springer', 'iTextÂ® 5.3.5 Â©2000-2012 1T3XT BVBA (SPRINGER SBM; licensed version)', 449822, '10/24/2025, 5:58:27 PM', 'D:20240520223305+05\'30\'', 'D:20240521110853+02\'00\'', 'null', NULL, 1.4, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'springer.com', 'springerlink.com', NULL, NULL, NULL, NULL, 'Humanities And Social Sciences Communications Volume', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '10.1057/s41599-024-03047-9', NULL, 'null', b'0', '1761317907040', NULL, '2024', 'Environmental litigation - Public interest in', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:51:31'),
(10, 'ULLMAN et al, A new dataset on compliance of UN treaty bodies, (2023).pdf', 'A Room Full Of ‘views’: Introducing A New Dataset To Explore Compliance With The Decisions Of The Un Human Rights Treaty Bodies’ Individual Complaints Procedures', 'Journal of Conflict Resolution 0.0:00220027231160460', 'Andreas J. Ullmann; Andreas Von Staden', 'Quantitative research into the effectiveness of the UN human rights treaty bodies (UNTBs) in eliciting remedial responses from states is impeded by a lack of usable data on how states respond to their decisions. The new Treaty Body Views Dataset (TBVD) aims to fill this gap. It comprises details on all published decisions in individual complaints cases issued by the UNTBs between 1979 and 2019 and matches these with information on their state of compliance. The TBVD can be used for research on the activities of the treaty bodies, the nature of the decisions themselves, or state behavior following a decision. An empirical application illustrates how the TBVD can advance knowledge about the factors that correlate with compliance with adverse UNTB decisions. Results show that the likelihood of implementation hinges critically on decision-level characteristics, and reveal differences and similarities between compliance with UNTB decisions and regional human rights court judgments.', 'Arbortext Advanced Print Publisher 9.1.510/W Unicode', 'Acrobat Distiller 7.0 (Windows); modified using iText 4.2.0 by 1T3XT', 917291, '10/24/2025, 5:58:50 PM', 'D:20230316031744+05\'30\'', 'D:20230321161049+03\'00\'', 'null', 'human rights,international institutions,second-order compliance,individual complaints procedures,UN human rights treaty bodies', 1.5, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'journals.sagepub.com', NULL, 'TRUE', '15-Mar-2023', NULL, NULL, 'Sage Publishing', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '10.1177/00220027231160460', NULL, 'null', b'0', '1761317930517', NULL, '2023', 'eBook Samples', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:52:42'),
