(16, 'Aging and Covid-19 - making sense of a disrupted world, by M. Luszcynska & Marvin Formosa, free e-book.pdf', 'Ageing And Covid-19; Making Sense Of A Disrupted World', 'This volume presents a range of research approaches to the exploration of ageing during a pandemic situation, offering an array of studies from around the world to provide an international perspective on how best to understand the effects of the recent co', 'Maria Łuszczyńska; Marvin Formosa', 'The COVID-19 pandemic struck like a lightning on a clear sunny day. When reports surfaced on the probability of a new pandemic in the frst two months of 2020, the public felt no need for alarm. Many remembered the 2009–2010 H1N1 fu pandemic, which affected an estimated 61 million people, but caused only an estimated 275,000 hospitalisations and 12,500 deaths, and failed to entrench itself in most countries (Centers for Disease Control and Prevention 2009). Such a reaction could not be farther away from the future situation as the COVID-19 pandemic proved to be a to- tally different matter. Its rate of transmission was incredibly contagious and its death rate amongst older persons was extremely high. Hopes that COVID-19 will not break out from China were soon confounded as it rav- aged Northern Italy and brought hospitals and intensive care units in this region to breaking point. In a matter of weeks, other countries registered thousands of cases and an approximately 3.5% mortality rate when this fg- ure for H1N1 fu pandemic was solely 0.2% (Baldo et al. 2016). It is therefore understandable that since mid-2020 the scholarly arena has been now awash with policy reports and empirical research focusing on the aetiology and the wide-ranging economic, social and psychological impacts of the COVID-19 pandemic (Kumar & Dohle 2020; Lupton & Willis 2021; Riegelmen 2020).', 'Adobe InDesign CC 2014 (Macintosh)', 'Adobe PDF Library 11.0; modified using iTextÂ® 5.5.6 Â©2000-2015 iText Group NV (AGPL-version)', 7914493, '10/24/2025, 5:58:31 PM', 'D:20211110193234+05\'30\'', 'D:20211216193608+05\'30\'', 'en', 'coronavirus; COVID-19; pandemic; research methods; epidemic; disruption; lifecourse; ageing; aging; later life; gerontology; sociology; social attitudes; social care; social life; methodologies; qualitative; quantitative', 1.7, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Taylor & Francis Group', NULL, 'PDF/X-4', NULL, NULL, NULL, NULL, NULL, NULL, 'The process that creates this PDF constitutes a trade secret of codeMantra, LLC and is protected by the copyright laws of the United States', NULL, NULL, NULL, 'http://www.codemantra.com', NULL, NULL, 'null', b'0', '1761317911278', NULL, '2021', 'eBook Samples', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:55:30'),
(17, 'Death penalty in Africa, by Dirk van Zyl Smit (AHRLJ).pdf', 'The Death Penalty In Africa', NULL, 'Dirk Van Zyl Smit', 'This article examines the situation of the death penalty in Africa. It does so by addressing three main questions: First, to what extent is the death penalty in Africa in fact an issue about which one should be particularly concerned? Second, what are the restrictions on the death penalty in Africa? Third, what is to be done to strengthen the restrictions on the death penalty in Africa? In addition, the article examines the question whether article 4 of the African Charter on Human and Peoples’ Rights and its related provisions will inspire the abolition of the death penalty. It is suggested that challenging manda- tory death sentences, advancing procedural challenges, open debate on alternatives to the death penalty, and improving the national criminal justice system will strengthen restrictions on the death penalty in Africa. The article concludes that positive criminal justice reform rather than moralistic condemnation is the most effective route to the eventual abolition of the death penalty in Africa.', 'CorelDRAW Version 10.0', 'Corel PDF Engine Version 10.410', 95109, '10/24/2025, 5:58:30 PM', 'D:20131022141438+02\'00\'', 'D:20210331100706+03\'00\'', 'null', NULL, 1.6, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'African Human Rights Law Journal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317910076', NULL, '2013', 'Death Penalty in Africa (English and French), free/English', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:56:32'),
(18, 'Challenges Facing the International Court of Justice.pdf', 'An Overview Of The Challenges Facing The International Court Of Justice In The 21st Century', NULL, 'S. Gozie Ogbodo', 'The effectiveness of the International Court of Justice (ICJ) is critical for global survival and progress in the 21st century. Unfortunately, after over six decades in existence, the Court’s influence is declining. This work argues that to revitalize the influence and effectiveness of the Court, some vital reforms must be undertaken in the ICJ system. These reforms must address: (1) the process of election and re-election of ICJ judges; (2) the conflict of interest arising from the presence of permanent members of the United Nations Security Council on the Court; (3) the issue of the Court’s compulsory jurisdiction; and (4) the appointment of ad hoc judges under Article 31 of the Statute of the Court.', 'Appligent AppendPDF Pro 5.5', 'Prince 9.0 rev 5 (www.princexml.com)', 299538, '10/24/2025, 5:58:31 PM', 'D:20160823041914-07\'00\'', 'D:20160823041914-07\'00\'', 'null', NULL, 1.7, b'0', b'0', b'0', b'0', b'0', NULL, 'AppendPDF Pro 5.5 Linux Kernel 2.6 64bit Oct  2 2014 Library 10.1.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Golden Gate University School Of Law', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317911468', NULL, '2012', 'eBook Samples', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 13:41:54'),
