(23, 'Human Rights Jurisdiction of the African Court of Justice and human and peoples rights- Rachel Murray.pdf', 'The Human Rights Jurisdiction Of The African Court Of Justice And Human And Peoples’ Rights', NULL, 'Rachel Murray', 'After the adoption of the Malabo Protocol of the African Court of Justice and Human and Peoples’ Rights in 2014, most of the discussion has centred around the criminal jurisdiction of the Court. The human rights jurisdiction of the proposed ACtJHPR has been less visible. This chapter will, firstly, provide an overview of the current ACHPR Court before moving on to consider the human rights jurisdiction of the proposed Court in the Malabo Protocol’s Statute of the ACtJHPR. It explores some of the challenges the Court may face and proffer some practical suggestions on how to take the issues forward', 'Arbortext Advanced Print Publisher 9.0.223/W Unicode', 'Acrobat Distiller 10.0.0 (Windows)', 180820, '10/24/2025, 5:58:43 PM', 'D:20190327164132+05\'30\'', 'D:20211027193944+00\'00\'', 'null', NULL, 1.3, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cambridge University Press', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317923732', NULL, '2019', 'eBook Samples', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 13:48:36'),
(24, 'Constitutional Courts in New Democracies- Understanding Variation in East Asia.pdf', 'Constitutional Courts In New Democracies: Understanding Variation In East Asia', 'Comparative Legal Institutions', 'Tom Ginsburg', 'The article shows how judicial review has expanded around the globe from the United States, Western Europe, and Japan to become a regular feature of constitutional design in Africa and Asia. Although the formal power to exercise judicial review is now nearly universal in democratic states, courts have varied in the extent to which they are willing to exercise this power in practice. After decades of authoritarian rule, East Asia has experienced a wave of democratization since the mid-1980s. Transitions toward more open political structures have been effectuated in Korea, Taiwan, Thailand, Mongolia and Indonesia, and even the Leninist states of China and Vietnam have experienced tentative moves toward more participatory politics. These political transitions have been accompanied by an important but understudied phenomenon: the emergence of pow- erful constitutional courts in the region. Constitutional courts have exercised review to challenge political authorities when conflicts arise among government institutions or governments impinge on individual rights.', 'Appligent APSetDocInfo 2.2.2', 'SPDF', 397510, '10/24/2025, 5:58:27 PM', 'D:20110302150242-08\'00\'', 'D:20110302150242-08\'00\'', 'null', 'Judicial Review, Eastern Asian Countries, Political Transition', 1.4, b'0', b'0', b'1', b'0', b'0', NULL, 'APSetDocInfo 2.2.2 Jan 16 2008', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'University Of Illinois, Urbana- Champaign', NULL, NULL, NULL, NULL, NULL, '1122.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317907331', 'null', '2011', 'Role of constitutional Courts', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 13:49:49'),
(25, 'Study of the Death Penalty in South Africa.pdf', 'Robert Turrell, White Mercy. A Study Of The Death Penalty In South Africa', NULL, 'Dior Konaté', 'Turrell’s book is an in-depth look at «How a condemned man’s and woman’s fate was determined after a death sentence was handed down in South Africa». Using mercy records, Turrell examines the role of death penalty in managing homicidal violence in a racist South African during the first half of the twentieth century.', 'OpenEdition', 'OpenEdition PDF Server v2', 133254, '10/24/2025, 5:58:30 PM', 'D:20200921163402+02\'00\'', 'D:20210331105151+03\'00\'', 'null', NULL, 1.5, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Crime, Histoire & Sociétés / Crime, History & Societies', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317910138', NULL, '2005', 'Death Penalty in Africa (English and French), free/English', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:59:50'),
(26, 'Death penalty  in the Middle East and North Africa.pdf', 'The Death Penalty In The Middle East And North Africa', 'Policy Department, DG Expo, European Parliament', 'Anastasia Calvieri; Anete Bandone; Pekka Hakala', 'In the last 50 years, the fight for the abolition of capital punishment has become one of the most important human rights objectives. According to Article 6 of the International Covenant on Civil and Political Rights (ICCPR), which was signed in 1966 and entered into force in 1976, \\\\\\\'every human being has the inherent right of life\\\\\\\'. This principle is strongly supported by a large group of non-governmental organisations (NGOs)1., as well as the European Union, which holds an emphatic and principled position against the death penalty. Abolition is a key objective for the Union’s human rights policy. Abolition is, of course, also a pre-condition for membership in the Union. Currently more than three quarters of the United Nations\\\\\\\' Member States have either abolished the death penalty or introduced a moratorium. Despite this global trend, most countries in the Middle-East and North Africa (MENA) still widely apply the capital punishment.', 'Acrobat PDFMaker 9.1 for Word', 'Acrobat Distiller 9.4.0 (Windows)', 371527, '10/24/2025, 5:58:30 PM', 'D:20121204155036+01\'00\'', 'D:20210331130450+03\'00\'', 'null', NULL, 1.5, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Directorate-general For External Policies Policy Department', NULL, NULL, NULL, NULL, NULL, NULL, 'D:20121204144217', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317910013', NULL, '2012', 'Death Penalty in Africa (English and French), free/English', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:01:47'),
