(31, 'Elections and Democracy Representation and Accountability by Jacques Thomassen (z-lib.org) - E-book.pdf', 'Elections And Democracy: Representation And Accountability', NULL, 'Jacques Thomassen', 'The Comparative Study of Electoral Systems (CSES) is a collaborative program of research among election study teams from around the world. Participating coun- tries include a common module of survey questions in their post-election studies. The resulting data are deposited along with voting, demographic, district, and macro variables. The studies are then merged into a single, free, public dataset for use in comparative study and cross-level analysis. The set of volumes in this series is based on these CSES modules, and the vol- umes address the key theoretical issues and empirical debates in the study of elec- tions and representative democracy. Some of the volumes will be organized around the theoretical issues raised by a particular module, while others will be thematic in their focus. Taken together, these volumes will provide a rigorous and ongoing contribution to understanding the expansion and consolidation of democracy in the twenty-first century.', 'Adobe InDesign CS5 (7.0)', 'Adobe PDF Library 9.9', 1901142, '10/24/2025, 5:58:35 PM', 'D:20140702021043Z', 'D:20140702023633+01\'00\'', 'null', NULL, 1.6, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'OUP Premium', NULL, 'Oxford University Press Premium', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317915581', NULL, '2014', 'eBook Samples', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:02:55'),
(32, 'Environmental Justice.pdf', 'Environmental Justice', 'Annu. Rev. Environ. Resourc. 2009.34:405-430', 'Paul Mohai; David Pellow; J. Timmons Roberts', 'The article reviews two decades of scholars’ claims that exposures to pollution and other environmental risks are unequally distributed by race and class, examines case studies of environmental justice social movements and the history and politics of environmental justice policy making in the United States, and describes the emerging issue of global climate justice. The authors engage the contentious literature on how to quantitatively measure and document environmental injustice, especially the complex problems of having data of very different types and areas (such as zip codes, census tracts, or concentric circles) around polluting facilities or exposed populations. Also considered is the value of perspectives from critical race theory and ethnic studies for making sense of these social phenomena. The article concludes with a discussion of the globalization of the environmental justice movement, discourse, and issues, as well as with some policy implications of finding and understanding environmental justice. One unique feature of this review is its breadth and diversity, given the different approaches taken by the three coauthors.', NULL, 'iText 2.1.5 (by lowagie.com)', 333666, '10/24/2025, 5:58:26 PM', 'D:20091018095403-07\'00\'', 'D:20140730135752-05\'00\'', 'null', NULL, 1.4, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Annual Reviews', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'PB:228202345_AS:124718787076096@1406746684961', 'null', b'0', '1761317906842', NULL, '2009', 'Environmental justice', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:03:37'),
(33, 'ENVIRONMENTAL JUSTICE AND DISSENT FOR POSTCOLONIAL URBAN SUSTAINABILITY TRANSITIONS.pdf', 'Environmental Justice And Dissent For Postcolonial Urban Sustainability Transitions', 'Int J Urban Regional Res 2023.47:645-664', 'Matt Johnston; Dan Darkey; Hilde Ibsen', 'Environmental justice principles are widespread at national and global levels of transition discourse, but this is sometimes irrelevant to marginalized communities. To address this issue, we apply environmental justice theory to a participatory postcolonial urban case study where poverty, unemployment and inequality continue to incentivize unregulated exploitation of vulnerable environments and people. It is unclear how national legislation can provide for indiscriminate access to environments that promote wellbeing in complex postcolonial communities, where xenophobic and economic discrimination reproduces colonial-style inequalities. To resist this injustice, the combination of academic and ordinary expressions of critique that confront regressive praxis and orthodoxies becomes a valuable and constructive political innovation for transitions. Empirical results suggest that enfranchising the most vulnerable proponents of transformation could advance their political capital to advocate for themselves, formulate and enculturate decolonized visions of urban sustainability, demand governmental and commercial accountability and foster urban reform that is relevant to them.', 'Adobe InDesign 15.1 (Windows)', 'Adobe PDF Library 15.0; modified using iText 4.2.0 by 1T3XT', 6002601, '10/24/2025, 5:58:26 PM', 'D:20230714151814+05\'30\'', 'D:20230808041215-07\'00\'', 'en-US', NULL, 1.7, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'International Journal Of Urban And Regional Research', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '10.1111/1468-2427.13179', '10.1111/(ISSN)1468-2427', '3', NULL, NULL, NULL, 'null', b'0', '1761317906802', NULL, '2023', 'Environmental justice', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:03:51'),
(34, 'Environmental justice and sustainable development.pdf', 'Environmental Justice And Sustainable Development: Integrating Local Communities In Environmental Management', 'Integrating Local Communities in Environmental Management', 'Patricia Kameri- Mbote, Philippe Cullet', '', 'Adobe InDesign CS (3.0)', 'Adobe PDF Library 6.0', 319710, '10/24/2025, 5:58:26 PM', 'D:20040502193104Z', 'D:20040504193150+01\'00\'', 'null', 'International Environmental Law Research Centre IELRC', 1.5, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'International Environmental Law Research Centre', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Standard', b'0', '1761317906818', 'null', '2004', 'Environmental justice', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 14:02:32'),
(35, 'Environmental_Justice, income, race  and health.pdf', 'Environmental Justice: Race, Poverty, And Environmental Health', NULL, 'Rachel Massey', 'Protecting the environment is sometimes viewed as a luxury -- something people care about only when they have plenty of leisure time and disposable income. In practice, low-income communities and minority ethnic groups often bear the most severe consequences of environmental degradation and pollution. In this module, we explore questions related to the distribution of pollution and other forms of environmental degradation. Our discussion is centered on environmental justice: the recognition that minority and low-income communities often bear a disproportionate share of environmental costs – and the perception that this is unjust.', 'Microsoft Word', 'Mac OS X 10.12.5 Quartz PDFContext', 721007, '10/24/2025, 5:58:26 PM', 'D:20171012194832Z00\'00\'', 'D:20171012194832Z00\'00\'', 'null', NULL, 1.4, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Global Development And Environment Institute.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317906850', NULL, '2004', 'Environmental justice', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 14:06:23'),
(36, 'European Consensus and the Legitimacy of the European Court of Human Rights (Kanstantsin Dzehtsiarou) (z-lib.org).pdf', 'European Consensus And The Legitimacy Of The European Court Of Human Rights', NULL, 'Kanstantsin Dzehtsiarou', 'In order to be effective, international tribunals should be perceived as legitimate adjudicators. European Consensus and the Legitimacy of the European Court of Human Rights provides in-depth analyses on whether European consensus is capable of enhancing the legitimacy of the European Court of Human Rights. Focusing on the method and value of European consensus, it examines the practicalities of consensus identi- fication and application and discusses whether State counting is appro- priate in human rights adjudication. With over 30 interviews from judges of the European Court of Human Rights and qualitative analyses of the case law, this book gives readers access to first-hand and up-to-date information and provides an understanding of how the European Court of Human Rights in Strasbourg interprets the European Convention on Human Rights.', 'Arbortext Advanced Print Publisher 11.0.3352/W Unicode', 'Cambridge University Press', 1184292, '10/24/2025, 5:58:51 PM', 'D:20150505110834Z', 'D:20150509124200+01\'00\'', 'null', NULL, 1.6, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Cambridge University Press', NULL, 'Cambridge University Press', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317931260', NULL, '2015', 'E-books Copyrighted', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:04:32'),
