(43, 'Role of the Constitutional Court in a Democratic Society.pdf', 'Role Of The Constitutional Court In A Democratic Society', NULL, 'Rait Maruste', 'The constitutional court is a central but not the only instrument of democracy and constitutionalism. There cannot be a constitutional court without a constitution. Therefore, the role of the constitutional court should be viewed in a wider perspective embracing the general issues of democracy, constitution, and constitutional- ism. There is reason to believe that, relying on our earlier experience of statehood and having lived according to our constitution and practising democracy for the past 15 years, while being in close co-operation with demo- cratic states in Europe and elsewhere in the world, we have learned something. We have passed the beginner course in constitutional democracy. This allows me to limit the ‘general part’, as lawyers would say, and address some issues of Estonian consti- tutionalism that concern us today. My article broadly consists of two parts: the first considers the role of the constitution and constitutional court in democratic society, and the second part (the ‘implementation’ part) briefly assesses Estonia’s current situation of constitutional law and asks how we should proceed.', 'PScript5.dll Version 5.2.2', 'Acrobat Distiller 8.1.0 (Windows)', 203100, '10/24/2025, 5:58:27 PM', 'D:20071207101146+02\'00\'', 'D:20071216163300+02\'00\'', 'null', NULL, 1.6, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Juridica International', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317907519', NULL, '2007', 'Role of constitutional Courts', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 14:14:55'),
