(48, 'Judicial Borrowing - International & Comparative Law as Nonbinding Tools of Domestic Legal Adjudication.pdf', 'Judicial Borrowing: International &(and) Comparative Law As Nonbinding Tools Of Domestic Legal Adjudication With Particular Reference To Estonia', NULL, 'Julia Laffranque', 'The article analyzes the pros and cons of judicial borrowing, explains the use of international as well as comparative law in domestic legal adjudication with particular reference to the Supreme Court of Estonia, and introduces opinion number nine of the Consultative Council of European judges. According to the author, judicial borrowing means to broaden one\\\\\\\'s vision; it does not stand for copying foreign examples, but for learning from them and enriching one\\\\\\\'s own legal system. In this respect, the legal culture and traditions, as well as the mentality of judges, play an important role. One of the aims of judicial borrowing is to ensure the protection of the rule of law and human rights, as well as the implementation of international obligations, and for European countries, effective application of European law. The author believes that if used properly, judicial borrowing is more advantageous than staying in isolation from global legal developments.', 'Appligent pdfHarmony 2.0', 'Prince 12.5 (www.princexml.com)', 968192, '10/24/2025, 5:58:49 PM', 'D:20220401183652-07\'00\'', 'D:20220401183652-07\'00\'', 'en', NULL, 1.7, b'0', b'0', b'1', b'0', b'0', NULL, 'pdfHarmony 2.0 Linux Kernel 2.6 64bit Mar 13 2012 Library 9.0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The International Lawyer', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317929365', NULL, '2022', 'eBook Samples', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 14:24:04'),
