(63, 'ABOLITION OF THE DEATH PENALTY IN AFRICA (AMNESTY INTERNATIONAL).pdf', 'Microsoft Word - 01480 Ai Dp Advocacy Toolkit Print.docx', NULL, 'Amnesty International', 'This toolkit is for the use of activists working on the abolition of the death penalty in Africa. It is intended to equip them with some key advocacy tools to effectively influence the institutions and individuals who can make abolition a reality in the region. The toolkit is divided into four sections. The first section gives a global overview of the use of the death penalty with a particular focus on the situation in Africa. The second section outlines the provisions in global and regional human rights instruments that are relevant to the death penalty. The third section addresses common claims made to support the use of the death penalty and sets out the most important and effective arguments to counter these. The fourth section focuses on some practical approaches to carrying out advocacy at national, regional and global levels. This provides key concepts, suggestions and tips for advocacy that activists can use to strengthen and broaden their work against the death penalty. The toolkit has an appendix which provides information about the death penalty classification of countries of the world; African countries’ ratification of a selection of UN treaties relevant against the death penalty; and the voting record of African countries at the United Nations General Assembly (UNGA) regarding a resolution on the moratorium on the use of the death penalty. This toolkit is not intended to be an exhaustive guide. Activism on the abolition of the death penalty in Africa has a long history, and new challenges and opportunities continue to arise. Amnesty International hopes that this toolkit will support and strengthen the work of activists, whether they are relatively new to the issue or experienced campaigners, and that it will contribute to the global effort to combat the use of the death penalty and eventually end it. Amnesty International opposes the death penalty in all cases without exception regardless of the nature or circumstances of the crime, regardless of the guilt, innocence or other characteristics of the individual and regardless of the method used by the state to carry out the execution. The Universal Declaration of Human Rights (UDHR) of 1948 recognizes each person’s right to life (Article 3) and states that “No one shall be subjected to torture or to cruel, inhuman or degrading treatment or punishment” (Article 5). In Amnesty International’s view, the death penalty violates these rights.', 'Word: cgpdftops CUPS filter', 'Acrobat Distiller 10.1.4 (Macintosh)', 6360220, '10/24/2025, 5:58:29 PM', 'D:20191015101317+01\'00\'', 'D:20210331102133+03\'00\'', 'null', NULL, 1.6, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Amnesty International', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317909920', NULL, '2019', 'Death Penalty in Africa (English and French), free/English', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:13:57'),
