(67, 'DEATH PENALTY IN BOTSWANA IN THE LIGHT OF INTERNATIONAL LAW - THE CASE FOR ABOLITION.pdf', 'The Death Penalty In Botswana In The Light Of International Law: The Case For Abolition', NULL, 'Onkemetse B Tshosa', 'It is almost trite to state that the imposition of the death penalty is a flagrant violation of the inalienable and immutable right to life. This right is recognised in various international human rights such as the Universal Declaration of Human Rights (UDHR), 1948; the International Covenant on Civil and Political Rights (ICCPR), 1966 and its Second Optional Protocol Aiming at the Abolition of the Death Penalty and the Africa Charter on Human and Peoples Rights (ACHPR), 1981. Also, at the national level, various constitutional instruments entrench the right to life including the Constitution of Botswana. Section 4 thereof unambiguously protects the individual right to life. Despite the protection of the right to life, the laws of Botswana also authorise the imposition of the death penalty thereby minimising the practical significance of the right to life. In this presentation, it is intended to examine the law in relation to the death penalty in Botswana in order to find out whether or not international normative standards could be utilised to inform national legal norms and ultimately influence it in abolishing the death penalty. As a matter of fact, Botswana is signatory to most international human rights instruments that protect the right to life and is thus legally obliged to respect and protect this right. The presentation will also examine judicial practice in the country in relation to the imposition of the death penalty in order to find out the trend in country, that is, whether the courts are merely effectuating the law or whether there is observable evidence that they may ultimately render it unconstitutional. Finally, the presentation will put forward a case for change in the law arguing that in this modern era the death penalty is anachronistically unwarranted and should be abolished.', 'PScript5.dll Version 5.2.2', 'Acrobat Distiller 5.0.5 (Windows)', 153406, '10/24/2025, 5:58:30 PM', 'D:20050216191102Z', 'D:20210331105422+03\'00\'', 'null', NULL, 1.3, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Onkemetse B Tshosa', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317910091', NULL, '2005', 'Death Penalty in Africa (English and French), free/English', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:19:37'),
