(72, 'Concerning constitutional courts in Central and Eastern Europe.pdf', 'Concerning Constitutional Courts In Central And Eastern Europe', NULL, 'Jonathan Bond', 'More impressive than the proliferation of constitutional courts throughout Central and Eastern Europe is the success of some, but not all, of these courts in transforming themselves into viable, formidable political actors despite the hostility of other branches of government and the absence of recent national experience with truly independent judiciaries. This essay examines this question by exploring the experience of Hungary and Poland’s constitutional tribunals, courts which were broadly similar in transitional profile but greatly divergent in outcomes. After identifying these key similarities and differences, the essay argues that at least two factors explain the contrasting experiences of these two countries: the context of legal continuity and the courts’ strategic responses to that context.', 'Word', 'Mac OS X 10.4.8 Quartz PDFContext', 537500, '10/24/2025, 5:58:27 PM', 'D:20061206201820-05\'00\'', 'D:20061206201839-05\'00\'', 'null', NULL, 1.6, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'The George Washington University Law School', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317907285', NULL, '2006', 'Role of constitutional Courts', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 14:41:33'),
