(76, 'DE SILVA et al, NGOs  international courts and state backlash against human rights accountability - ACtHPR, (2023).pdf', 'Ngos, International Courts, And State Backlash Against Human Rights Accountability: Evidence From Ngo Mobilization Against Tanzania At The African Court On Human And Peoples’ Rights', 'Law & Society Review 2023.57:36-60', 'Nicole De Silva; Misha Ariana Plagis', 'When nongovernmental organizations (NGOs) encounter state resistance to human rights accountability, how do NGOs use international courts for their human rights advocacy strategies? Considering the overlapping phenomena of shrinking civic space within authoritarian, hybrid, and demo- cratically backsliding regimes, and state backlash against international courts, NGOs navigate two potential levels of state backlash against human rights accountability. Building on the interdisciplinary scholarship on legal mobilization, we develop an integrated framework for explaining how states’ two-level (domestic and international) backlash tactics can both promote and deter NGOs’ strategic litigation at interna- tional human rights courts (IHRCs). States’ backlash tactics can influence NGOs’ opportunities, capacities, and goals for their human rights advocacy, and thus affect whether and how they pursue strategic litigation at IHRCs. We elucidate the value of this framework through case studies of NGOs’ litigation against Tanzania at the African Court on Human and Peoples’ Rights, an understudied IHRC. Drawing on an original data set, interviews, and documentation, we process- trace how Tanzania’s various backlash tactics influenced whether and how NGOs litigated at the Court. Our frame- work and analysis show how state backlash against human rights accountability affects NGOs’ mobilization at IHRCs and, relatedly, IHRCs’ opportunities for influence.', 'Arbortext Advanced Print Publisher 9.1.520/W Unicode', 'Acrobat Distiller 11.0 (Windows); modified using iText 4.2.0 by 1T3XT', 1102158, '10/24/2025, 5:58:35 PM', 'D:20230222155233+05\'30\'', 'D:20230321154933+03\'00\'', 'null', NULL, 1.7, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Social Sciences And Humanities Research Council Of Canada', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '10.1111/lasr.12639', '10.1111/(ISSN)1540-5893', '3', NULL, NULL, NULL, 'null', b'0', '1761317915423', NULL, '2023', 'eBook Samples', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 16:21:33'),
(77, 'Universal Periodic Review and Policy Change - The Case of National Human Rights Institutions.pdf', 'Universal Periodic Review And Policy Change - The Case Of National Human Rights Institutions', NULL, 'Luka Glušac', 'National human rights institutions have become a salient feature of national and global human rights architecture. Although scholars have paid much attention to their general relationship with the United Nations, it is surprising that very little has been written on how this has reflected in the Universal Periodic Review as the UN’s only peer-review human rights mechanism. This article aims to contribute to filling this gap. Firstly, the article presents original data on the frequency and regional distribution of national human rights institutions’ participation in the first two Universal Periodic Review cycles. Besides reporting, the author identifies a plethora of other entry points and offers recommendations on how national human rights institutions can maximize their impact on the Universal Periodic Review outcome. Secondly, this article explores if national human rights institutions have been the objects of Universal Periodic Review recommendations. Have the Member States advocated for the establishment and strengthening of national human rights institutions through the Universal Periodic Review or not? Have national human rights institutions been high on Member States’ (foreign) policy agendas? How have the States under Review responded to recommendations to establish national human rights institutions? The implications of these empirical questions are discussed in the context of human rights compliance and norm diffusion literature. The article argues that while having some features of ‘rights ritualism’, the insistently cooperative and inclusive character of the Universal Periodic Review facilitates a genuine discussion of existing human rights situations. This has a real potential to lead to human rights policy changes over time through the process of acculturation, which is demonstrated with the example of national human rights institutions-related Universal Periodic Review recommendations.', 'Arbortext Advanced Print Publisher 9.0.114/W', 'Adobe LiveCycle PDF Generator; modified using iTextSharp 4.1.6 by 1T3XT', 274443, '10/24/2025, 5:59:07 PM', 'D:20220322163632+05\'30\'', 'D:20220428064231+00\'00\'', 'null', NULL, 1.6, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Journal Of Human Rights Practice', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317947467', NULL, '2022', 'E-books Copyrighted', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 14:49:32'),
