(91, 'Highlights on the Concept of Environmental Justice and its Use.pdf', 'Some Highlights On The Concept Of Environmental Justice And Its Use', 'The article provides a review of the literature on environmental justice, aimed at showing the multifaceted character of the concept and how it has been used since the mid-80s, with special reference to its shift across the Atlantic and over time. It shou', 'Ilaria Beretta', 'The article provides a review of the literature on environmental justice, aimed at showing the multifaceted character of the concept and how it has been used since the mid-80s, with special reference to its shift across the Atlantic and over time. It should help to clarify the concept of environmental justice. Several authors have pointed out that the concept has been understood in different ways and it is necessary to have a clear definition of its meaning. I discuss the origins of the term environmental justice in the United States, analyze its use in the specialized literature, and examine how its meaning has changed in Europe, in other countries and through time. I then address the “distributional problem” and draw a brief conclusion.', 'OpenEdition', 'OpenEdition PDF Server v2', 396382, '10/24/2025, 5:58:26 PM', 'D:20190423120805', 'D:20190423120805+02\'00\'', 'null', 'environmental justice', 1.4, b'0', b'0', b'0', b'0', b'0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Centro De Estudos Sociais Da Universidade De Coimbra', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317906913', NULL, '2012', 'Environmental justice', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:31:33'),
(92, 'State Responsibility to Respect, Protect and Fulfill Human Rights - Obligations in Cyberspace.pdf', 'State Responsibility To Respect, Protect And Fulfill Human Rights Obligations In Cyberspace', NULL, 'Gabor Rona; Lauren Aarons', 'Debate over whether or not international human rights law applies to cyberspace and cyber-related activities has more or less been settled. It does apply, as it would to any other context. Yet, it is one thing to say that cyber communications, for example, hold the same civil and political protection as their offline predecessors, but it’s entirely another thing to say exactly what these protections are, where their limits may lie and the exact nature of the State’s obligations to protect communication rights vis-a-vis cyberspace. Indeed, there are a number of areas of controversy or confusion in the application of human rights law to cyberspace. Some reflect ongoing debates within the human rights legal field that pre-exist the emergence of cyber. These include questions concerning the relationship between human rights law and other international legal constructs such as the law of armed conflict, the territorial scope of application of human rights law obligations, and how to balance competing rights. But crucially, there are also a number of unique features of cyberspace that exacerbate these persistent tensions, or that call for the specific engagement/adaptation of human rights law to address new circumstances. Aspects of cyberspace that to some extent present new challenges include the mobility of data online, the amount of personal detail individuals render vulnerable through cyberspace, and the potential of acts emanating from or involving cyberspace to cause grave disruption and harm to others. This article considers the content and scope of application of international human rights law applicable to cyberspace. Instead of addressing head-on whether international human rights law is well-equipped to regulate the online world, it identifies how human rights law does apply to cyber, and where the application of human rights law remains unclear or, in some cases, ill-suited. Section one affirms the application of human rights law to cyberspace, and also considers its scope of application, including with regard to mobile data. Section two reflects on the content of a State’s obligation to respect human rights law in cyberspace. Section three addresses a State’s obligation to ensure respect for human rights (protect and fulfill rights) in cyberspace by protecting against third party abuse and by providing a remedy for violations. It also addresses State obligations to promote human rights in cyberspace and whether there is a right to access the Internet, or certain online content. Section four considers the limitations of human rights obligations and permissible restrictions in cyberspace. A conclusion follows.', 'Acrobat PDFMaker 11 for Word', 'Adobe PDF Library 11.0', 333257, '10/24/2025, 5:58:29 PM', 'D:20160606132002-04\'00\'', 'D:20170404000651+03\'00\'', 'EN-US', NULL, 1.5, b'0', b'0', b'1', b'0', b'0', NULL, NULL, NULL, NULL, 'Cardozo School of Law', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '8 J. Nat ’l Security L. & Pol’y', NULL, NULL, NULL, NULL, NULL, NULL, 'D:20160606171946', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'null', b'0', '1761317909803', NULL, '2016', 'Cybersecurity and human rights', 'application/pdf', '2025-10-25 15:04:11', '2025-10-27 15:35:08'),
